        if (x > 4) {
            break;
        }
        // Store the relative positions
        positions[0].x = x;
        positions[0].y = y;
        scanf("%d %d", &x, &y);
        positions[1].x = x;
        positions[1].y = y;
        scanf("%d %d", &x, &y);
        positions[2].x = x;
